import React from "react";
import "./Login.css";

import img1 from "../image/icon.png";
function Login() {
  return (
    <>
      <div className="container">
        <img src={img1} alt="" />
        <form action="" method="post">
          <input type="text" />
          <input type="text" />
          <input type="text" />
        </form>
      </div>
    </>
  );
}

export default Login;
